import React from 'react'
import { Navbar, Nav, Container, NavDropdown, Button, Row, Col, NavItem, NavLink } from 'react-bootstrap';
import { styled } from '@mui/material/styles';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import { connect } from 'react-redux';
import Paper from '@mui/material/Paper';

const StyledTableCell = styled(TableCell)(({ theme }) => ({
    [`&.${tableCellClasses.head}`]: {
        backgroundColor: "grey",
        color: theme.palette.common.white,
    },
    [`&.${tableCellClasses.body}`]: {
        fontSize: 14,
    },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
    '&:nth-of-type(odd)': {
        backgroundColor: theme.palette.action.hover,
    },
    // hide last border
    '&:last-child td, &:last-child th': {
        border: 0,
    },
}));

function createData(obj) {
    return obj.state;
}
var rows = [];



const Shipmentdetails = (props) => {

    let data = props.status.TransitEvents
    const formatDate = (dateString) => {
        const options = { year: "numeric", month: "long", day: "numeric" }
        return new Date(dateString).toLocaleDateString(undefined, options)
    }
    const formatTime = (dateString) => {
        // let date = new Intl.DateTimeFormat("en-US", {
        //     hour: "2-digit",
        //     minute: "2-digit",
        //     second: "2-digit",
        //   }).format(dateString);

        const options = { hour: '2-digit', minute: '2-digit', second: '2-digit' }
        return new Date(dateString).toLocaleTimeString(undefined, options)
    }


    let rows = data.map((obj) => { return transform(obj) })

    function transform(object) {
        let keyss = Object.keys(object);
        if(keyss.includes('reason')) {
            let transformed_values = [object['state'], formatTime(object['timestamp']), formatDate(object['timestamp']), 'Nasr City'];
        }
        else {
            let transformed_values = [object['state'], formatTime(object['timestamp']), formatDate(object['timestamp']), 'Nasr City'];
        }
        let values = Object.values(object);
        let transformed_values = [object['state'], formatTime(object['timestamp']), formatDate(object['timestamp']), 'Nasr City'];
        return transformed_values;
    }

    console.log("yarab", rows)
    console.log("yarab", rows[0])
    console.log(props.status.TransitEvents.map((event) => {
        createData(event)
    }))

    return (
        <Container>
            <Row>
                <Col className='col-12 col-md-8 '>
                    <p> Details</p>
                    <TableContainer component={Paper}>
                        <Table sx={{ minWidth: 700 }} aria-label="customized table">
                            <TableHead>
                                <TableRow>
                                    <StyledTableCell>Branch</StyledTableCell>
                                    <StyledTableCell align="left">Date</StyledTableCell>
                                    <StyledTableCell align="left">Time</StyledTableCell>
                                    <StyledTableCell align="left">Details</StyledTableCell>
                                </TableRow>
                            </TableHead>
                            <TableBody>

                                {rows.map((row) => (
                                    <StyledTableRow key={row[3]}>
                                        <StyledTableCell component="th" scope="row">
                                            {row[3]}
                                        </StyledTableCell>
                                        <StyledTableCell align="left">{row[2]}</StyledTableCell>
                                        <StyledTableCell align="left">{row[1]}</StyledTableCell>
                                        <StyledTableCell align="left">{row[0]}</StyledTableCell>
                                    </StyledTableRow>
                                ))}
                            </TableBody>
                        </Table>
                    </TableContainer>

                </Col>
                <Col className='col-12 col-md-4 '>
                    <Row>
                        <p> Address</p>
                        <Paper>
                            30, Rue Ahmed Orabi , Al-Mohandessine
                            GIZA - 12411
                            EGYPT

                        </Paper>
                    </Row>
                    <Row>
                        <Paper>
                            <Row>
                                <Col className='col-12 col-md-4 '>
                                    test

                                </Col>
                                <Col className='col-12 col-md-8 '>
                                    Are you facing any problems?
                                    <Button> Report a problem</Button>
                                </Col>
                            </Row>

                        </Paper>
                    </Row>
                </Col>
            </Row>
        </Container>
    )
}

const mapStateToProps = state => ({

    status: state.guest.details,
    detailsfetched: state.guest.detailsfetched
})
export default connect(mapStateToProps)(Shipmentdetails);
